<p>I was reading that it should be possible to have a date object directly in the database, but I can't get it to work.</p>
<p>Also I was wondering if it is the best solution or if I should just store my dates as &quot;Epoch millis&quot; instead?</p>
<p>I am trying to use use the <code>$dateFromString</code> keyword which should work but i receive this error:</p>
<pre><code>bson.errors.InvalidDocument: key '$dateFromString' must not start with '$'
</code></pre>
<p>My code looks like this:</p>
<pre><code>from datetime import date
import pymongo

dbcli   = pymongo.MongoClient('mongodb://192.168.1.8:27017')
db      = dbcli['washbase']
col     = db['machine']

def conv(dato):
    return {
            '$dateFromString': {
                'dateString': dato,
                'format': '%Y-%m-%d',
                'timezone':'Europe/Copenhagen',
                }
            }

today = date.today().isoformat()

data = {
        'day': conv(today),
        'time':12,
        'room':'2B',
        }


col.insert_one(data)
</code></pre>
<p>The reason why I need something like a date-object in the database is because I want to do a conditional query on the data, so that the database only sends the data i require. So i expect to do something like this.</p>
<pre><code>result = col.find(
        {
            'day' : {
                '$gt' : {
                    '$date' : '2020-01-01'
                    }
                }
            }
        )
for x in results:
    print(x)
</code></pre>
<p>But when I do this the app prints nothing.</p>

